import Svg, { G, Path } from 'react-native-svg';
/* SVGR has dropped some elements not supported by react-native-svg: style */

export const IconInsightsOutline = props => (
  <Svg
    width={22}
    height={22}
    fill="none"
    xmlns="http://www.w3.org/2000/svg"
    {...props}
  >
    <G id="Insights">
      <Path
        d="M4.1 7.8v11.5H2.4V7.8h1.7m1.5-1.5H.9v14.5h4.7V6.3zM11.8 2.4v17H10v-17h1.8M13.3.9H8.5v20h4.7V.9h.1zM19.4 12.1v7.3h-1.7v-7.3h1.7m1.5-1.5h-4.7v10.3h4.7V10.6z"
        fill={Colors.HERO_BLUE}
      />
    </G>
  </Svg>
);
